  of the Northern Half of the Pseudo-colored Backscatter Intensity of the Sea Floor
  off Northeastern Cape Cod (CAPENORTHPSEUDO_GEO4M_WGS84.TIF, Geographic, WGS84)\",\n\t\"tracking_summary\":
